import car from "./car.jpg";

function CarInfo({ carDetails }) {
  return carDetails ? (
    <div>
      <h1 claclassNamess="font-mono text-sm text-center">About this car...</h1>
      <p className="font-mono text-center font-medium">
        Registration: {carDetails.registration}
      </p>
      <p className="font-mono text-center font-medium">
        Make: {carDetails.make}
      </p>
      <p className="font-mono text-center font-medium">
        Model: {carDetails.model}
      </p>
      <p className="font-mono text-center font-medium ">
        Colour: {carDetails.primaryColour}
      </p>
      <p className="font-mono text-center font-medium text-emerald-800">
        MOT expires on: {carDetails.motTests[0].expiryDate}
      </p>
      <p className="font-mono text-center font-medium">
        Last recorded mileage: {carDetails.motTests[0].odometerValue}
      </p>
    </div>
  ) : (
    <div>
      <img src={car} alt="car" className="img-primary" />
    </div>
  );
}

export default CarInfo;
